window.bookSummaryJSON = "<p><b>The Ever After Duet concludes with </b><b><i>Fourkeeps</i></b><b>....</b></p> <p>When you’re wealthy, you’re used to getting what you want.</p> <p>But when what you want is a gorgeous woman to share a lifetime - and a really big bed - with you and your three best friends, it can be a tough sell.</p> <p>Ford, Brady, and Josh are determined that nothing will keep them apart. Not Kari’s past or the psychopath who keeps threatening their future.</p> <p>One night with her was amazing, but it could never be enough.</p> <p>This time, they’re playing for keeps.</p> <p><b><i>Fourkeeps</i></b><b> is the conclusion of the Ever After Duet, and should be enjoyed following </b><b><i>Fourplay.</i></b></p>"; 
